import axios from "axios";
import { useEffect } from "react";


const Users = () => {

    useEffect(()=>{
        const users = axios.get("http://locahost:3005/register/users");
        console.log("users", users)
    },[]) 

    return(
        <div>
            Users
        </div>
    )
}

export default Users;
